import './css/Turtle.css';
import React from 'react';

export default function Turtle() {
    return(
        <div className='menu'>
            <div className='San' />
            <div className='Namu1' />
            <div className='Namu2' />
            <div className='Namu3' />
            <div className='Namu4' />
            <div className='Namu5' />
            <div className='pul' />
            <p className='pageName'>거북이 수족관</p>
            <p className='logOut'>로그아웃</p>
        </div>
    )
}
